import React, { memo } from 'react';
import Layout from '../../components/shared/Layout/Layout'


const About = memo(() => {
  return (
    <Layout>
    <div className="home">
        <img className="avatar" src="https://i.imgur.com/KPHLLDY.jpg" alt-text=""></img>
        <h2><center>About Me</center></h2>
        <p className="paragraph">Experienced Executive with a demonstrated history of working in the Information Technology and Software Engineering industry. Skilled in Project Management, Business Process, Budgeting, Analytical Skills, Requirements Analysis, Software Development and Government. Strong business development professional with a Bachelor of Business Administration (B.B.A.) focused in Finance, General from Morehouse College.</p>
    </div>
  </Layout>
  );
});

export default About;
